    public static String checksum(String[] input) {
        final int errorMargin = 1;
        for (int rowIndex = 0; rowIndex < input.length; rowIndex++) {
            String line = input[rowIndex];
            for (int rowIndexNext = rowIndex + 1; rowIndexNext < input.length; rowIndexNext++) {
                String nextLine = input[rowIndexNext];
                int errors = 0;
                String commonCharacters = new String();
                for (int charIndex = 0; charIndex < line.length(); charIndex++) {
                    if(line.charAt(charIndex) != nextLine.charAt(charIndex)) {
                        errors++;
                    } else {
                        commonCharacters+= line.charAt(charIndex);
                    }
                    if (errors > errorMargin) {
                        break;
                    }
                    if(charIndex == line.length() - 1) {
                        return commonCharacters;
                    }
                }
            }
        }
        return "No matches";

    }
